text:
Combatir la desigualdad es un deber de todo gobierno pero el PIT CNT tiene que sincerar su discurso. La desigualdad de ingresos en Uruguay se mantiene en los mismos niveles desde el año 2012 con gobiernos de Mujica y Tabaré.
Dialogar en vez de confrontar.
